import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./index.css";

function Games() {
  return (
    <div className="slider">
      <div>Slide #1</div>
      <div>Slide #2</div>
      <div>Slide #3</div>
      <div>Slide #4</div>
      <div>Slide #5</div>
    </div>
  );
}

export default Games;
